import React from 'react'
import { Swiper, SwiperSlide } from "swiper/react";
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';
import { Autoplay } from 'swiper/modules';

function Brandsworked() {
    return (
        <section>
            <div className="container text-white">
                <div className="brand-work text-center ">
                    <h4>BRANDS</h4>
                </div>
                <div className="brand-slides pt-md-5 pt-sm-2 ">
                <Swiper
                        spaceBetween={10}
                        slidesPerView={5}
                        freeMode={true}
                        autoplay={{
                          delay: 4000,
                          disableOnInteraction: false,
                        }}
                        breakpoints={{
                          320: {
                            slidesPerView: 1
                          },
                          576: {
                            slidesPerView: 2
                          },
                          768:{
                            slidesPerView: 3
                          },
                          1200: {
                            slidesPerView: 4
                          }
                        }}
                        modules={[Autoplay]}
                        onSlideChange={() => console.log("slide change")}
                        onSwiper={(swiper) => console.log(swiper)}
                        className="main_slider33"
                      >
                        <SwiperSlide>
                            <div className="patch-bname" data-aos="flip-left">
                                <h5>OUTLAST</h5>
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="patch-bname">
                                <h5>OUTLAST INFRA</h5>
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="patch-bname" data-aos="flip-left">
                                <h5>JENNIS CATERING</h5>
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="patch-bname" data-aos="flip-right">
                                <h5>WHITE SHADOW ACADEMY</h5>
                            </div>
                        </SwiperSlide>
                      </Swiper>
                </div>

            </div>
        </section>
    )
}

export default Brandsworked
